In Java, input validation support is specific to the frameworks being used. One powerful method to implement input validation is to define an input validation class that implements the javax.faces.validation.Validation interface. Here's an example code snippet:

```java
public class UsernameValidator implements Validator {

    public void validate(FacesContext facesContext, UIComponent uiComponent, Object value) throws ValidatorException {
        // Get the supplied username and cast it to a string
        String username = (String) value;

        // Set up regular expression pattern
        Pattern p = Pattern.compile("^[a-zA-Z]{8,12}$");

        // Match the username
        Matcher m = p.matcher(username);

        if (!m.matches()) {
            FacesMessage message = new FacesMessage();
            message.setDetail("Not valid - it must be 8-12 letters only");
            message.setSummary("Username not valid");
            message.setSeverity(FacesMessage.SEVERITY_ERROR);
            throw new ValidatorException(message);
        }
    }
}
```

To enable the validator, you need to add the following code to the faces-config.xml file:

```xml
<validator>
    <validator-id>namespace.UsernameValidator</validator-id>
    <validator-class>package.UsernameValidator</validator-class>
</validator>
```

You can use or refer to the related TLD file as well.

An additional resource for implementing input validation in Java is the OWASP Enterprise Security API, which is freely available and can help you build a secure application.

In PHP, input validation is typically implemented directly in the program. There are several functions in PHP that can be used for building input validation. Some of them include checking the length of input, checking the type of input, and using regular expressions for matching. 

For example, you can use the `preg_match()` function to match a regular expression with the input. Here's an example:

```php
$username = $_POST['username'];

if (preg_match("/^[a-zA-Z0-9]+$/", $username)) {
    // handle successful validation
} else {
    // handle failed validation
}
```

You can also use other functions depending on your specific validation needs.

To validate input using JavaScript, you can use various methods and functions. One common approach is to use regular expressions to match and validate the input. Here's an example of JavaScript code for input validation:

```javascript
<!DOCTYPE html>
<html>
<body>

<h1>JavaScript Validation Example</h1>

<p>Please enter a number between 1 and 20:</p>

<input id="numb">

<button type="button" onclick="myFunction()">Validate</button>

<script>
function myFunction() {
  var input = document.getElementById("numb").value;
  var pattern = /^[1-9][0-9]?$|^20$/; // Regular expression to match numbers between 1 and 20
  if (pattern.test(input)) {
    alert("Input is valid!");
  } else {
    alert("Input is not valid. Please enter a number between 1 and 20.");
  }
}
</script>

</body>
</html>
```

In this example, the JavaScript function `myFunction()` is called when the "Validate" button is clicked. It retrieves the input value from the HTML input element with the id "numb". Then, it uses a regular expression pattern (`/^[1-9][0-9]?$|^20$/`) to check if the input matches the desired criteria (numbers between 1 and 20). If the input is valid, an alert message saying "Input is valid!" is displayed. Otherwise, an alert message saying "Input is not valid. Please enter a number between 1 and 20." is displayed.

